"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Rectal prolapse in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/rectal-prolapse-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H9656400\">",
"      <span class=\"h1\">",
"       What is rectal prolapse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Rectal prolapse is a condition that happens when some or all of the tissue that lines the rectum sticks out of the anus (",
"      <a class=\"graphic graphic_figure graphicRef58531 \" href=\"UTD.htm?12/60/13250\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      It is most common in babies and children younger than 4 who also have another health problem. The most common problems are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Constipation &ndash; This means the child&rsquo;s bowel movements:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Are too hard",
"       </li>",
"       <li>",
"        Are difficult to get out",
"       </li>",
"       <li>",
"        Happen fewer than 3 times a week",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Diarrhea - This means the child&rsquo;s bowel movements:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Are watery or runny",
"       </li>",
"       <li>",
"        Happen more than 3 times a day",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Problems with the brain or spinal cord &ndash; The spinal cord is the highway of nerves that connects the brain to the rest of the body. It runs through the spine (also called the backbone). These problems can cause weak muscles and affect the muscles near the rectum. Conditions that can lead to rectal prolapse include: &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Spina bifida - This condition happens when a baby&rsquo;s spine does not grow normally before birth.",
"       </li>",
"       <li>",
"        Brain and spinal cord injuries &ndash; These are usually caused by bad car crashes or falls.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Cystic fibrosis &ndash; This disease causes thick mucus and other fluids to build up and clog different parts of the body. Children with cystic fibrosis can have frequent lung infections. They also can have large, bulky bowel movements.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9656415\">",
"      <span class=\"h1\">",
"       What are the symptoms of rectal prolapse in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom is bright red tissue sticking out of the anus. The tissue might have mucus or blood. Rectal prolapse is not usually painful but can be uncomfortable. The tissue might stay outside the anus or move back inside the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9656430\">",
"      <span class=\"h1\">",
"       Is there a test for rectal prolapse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. But your child&rsquo;s doctor or nurse should be able to tell if your child has the condition by doing an exam. If the tissue has moved back inside your child&rsquo;s body, you can describe the tissue to the doctor. This can help the doctor know if the child has rectal prolapse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9656445\">",
"      <span class=\"h1\">",
"       How is rectal prolapse treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The doctor will push the rectal tissue back into the child&rsquo;s anus with a gloved finger. Some children need medicines to make them relaxed and sleepy before the doctor does this. The doctor can also teach parents how to push the tissue back if it comes out again.",
"     </p>",
"     <p>",
"      If this treatment does not work or the problem keeps coming back, the child might need surgery.",
"     </p>",
"     <p>",
"      Other treatments can help prevent rectal prolapse from happening again. The treatment depends on what caused the prolapse the first time.",
"     </p>",
"     <p>",
"      A child who is constipated and has rectal prolapse should:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Eat a diet that has lots of fruits and vegetables",
"       </li>",
"       <li>",
"        Sit on the toilet for 5 or 10 minutes after meals, if he or she is potty trained. Parents can give rewards just for sitting there.",
"       </li>",
"       <li>",
"        Stop potty training for a while, if he or she is in the middle of potty training",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Your child&rsquo;s doctor might also give your child medicines that soften bowel movements, such as PEG (sample brand name: MiraLAX&reg;).",
"     </p>",
"     <p>",
"      Children with diarrhea need treatment for the cause of the diarrhea. Most of the time, diarrhea is caused by an infection or is a side effect from a medicine.",
"     </p>",
"     <p>",
"      Children with rectal prolapse who do not have an obvious cause should be tested for cystic fibrosis. Children who already have cystic fibrosis can take medicines called &ldquo;pancreatic enzymes.&rdquo; These help make the child&rsquo;s bowel movements more regular.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9656460\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?42/2/43041?source=see_link\">",
"       Patient information: Constipation in children (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?33/34/34338?source=see_link\">",
"       Patient information: Diarrhea in children (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?19/57/20371?source=see_link\">",
"       Patient information: Cystic fibrosis (The Basics)",
"      </a>",
"     </p>",
