"   <div class=\"block pha drugH1Div\" id=\"F179355\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Sodium hyaluronate is a biological polysaccharide which is distributed widely in the extracellular matrix of connective tissue in man (vitreous and aqueous humor of the eye, synovial fluid, skin, and umbilical cord). Sodium hyaluronate and its derivatives form a viscoelastic solution in water (at physiological pH and ionic strength) which makes it suitable for aqueous and vitreous humor in ophthalmic surgery, and functions as a tissue and/or joint lubricant which plays an important role in modulating the interactions between adjacent tissues. Intradermal injection may decrease the depth of facial wrinkles. In the topical management of wounds and ulcers, sodium hyaluronate protects the skin against friction and abrasion.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F179369\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Intravitreous injection: Diffusion occurs slowly",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Ophthalmic: Via Canal of Schlemm",
"    </p>",
"   </div>",
"  </div>",
